function CardsData() {
    let titleLine;
    let image;
    let primaryText;
    let secundaryText;

    function SetCardsData(title, picture, primary, secundary){
        this.titleLine = title;
        this.image = picture;
        this.primaryText = primary;
        this.secundaryText = secundary;
    }   
}
